import axios from 'axios';
import React, { useEffect, useState } from 'react'
import { useNavigate, useParams } from 'react-router-dom';

export default function Dashboard() {

  let navigateTo = useNavigate();
 
  const { id } = useParams();

  const [student, setStudent] = useState([]);

  useEffect(() => {
      getStudentDetails();
  }, []);

  const getStudentDetails = async (id) => {

    // e.preventDefault();
    await axios.get(`http://localhost:4000/getStudentById/${id}`)
              .then((result) => {
                console.log(result);
                setStudent(result.data);
              });
  }

  const handleLogout = (e) => {
    // e.preventDefault();
    setStudent([]);
    navigateTo('/');
  };

  return (
    <>
      <div className="wrapper">
        <div className="inner">
          <form action="">
            <h3>  Dashboard  </h3>
            <p>Student Dashboard</p>
            <div>
              {student.map((existingStud) => {
                <tr>
                  <th>Name :- {existingStud.name}</th>
                  <th>Email :- {existingStud.email}</th>
                  <th>Password :- {existingStud.password}</th>
                </tr>
                // <tr>
                //   <th>Email :- </th>
                // </tr>
                // <tr>
                //   <th>Password :- </th>
                // </tr>
              })}
            </div>
            <button onClick={ handleLogout }>Logout</button>
          </form>
        </div>
      </div>
    </>

  )
}
